from math import sqrt
def fatora(x):
    lista = []
    salvo = 0
    while x != 1:
        if x%2 == 0:
            x = int(x/2)
            lista.append(2)
            continue
        for i in range(3, int(sqrt(x))+2, 2):
            if x%i == 0:
                x = int(x/i)
                lista.append(i)
                break
        if salvo == x:
            lista.append(x)
            break
        salvo = x
    return (lista)

def horacio(x, limStep):
    step = 0
    ante = 0
    atual = x
    while ante != atual:
        step += 1
        fatoracao = fatora(atual)
        soma = []
        for i in fatoracao:
            if i not in soma:
                soma.append(i)
        soma = sum(soma)
        ante, atual = atual, soma
        if step > limStep:
            return (False)
    if step == limStep:
        return True

